import React, { useState } from 'react';
import {
    Grid,
    Card,
    CardContent,
    Typography,
    Select,
    MenuItem,
    Button,
    AppBar,
    Toolbar,
    IconButton,
    Box,
} from '@mui/material';
import FilterAltIcon from '@mui/icons-material/FilterAlt';
import BusImage from '../assets/bus.jpg';
import TravelImage from '../assets/travel.jpg'; // Add appropriate image files
import FoodImage from '../assets/food.jpg'; // Add appropriate image files

const mockDeals = [
    { id: 1, title: 'Flight to NYC', category: 'Travel', subcategory: 'Flight', company: 'United Airlines', price: 200, image: TravelImage },
    { id: 2, title: 'Flight to LA', category: 'Travel', subcategory: 'Flight', company: 'Spirit Airlines', price: 180, image: TravelImage },
    { id: 3, title: 'Bus to Boston', category: 'Travel', subcategory: 'Bus', company: 'Greyhound', price: 30, image: TravelImage },
    { id: 4, title: 'Large Pepperoni Pizza', category: 'Food', subcategory: 'Pizza', company: 'Domino\'s', price: 12, image: FoodImage },
    { id: 5, title: 'Chicken Sandwich', category: 'Food', subcategory: 'Sandwiches', company: 'Subway', price: 10, image: FoodImage },
    { id: 6, title: 'Cheeseburger Meal', category: 'Food', subcategory: 'Burgers', company: 'Wendy\'s', price: 8, image: FoodImage },
];

const DealsPage = () => {
    const [selectedCategory, setSelectedCategory] = useState('');
    const [selectedSubcategory, setSelectedSubcategory] = useState('');

    const filteredDeals = mockDeals.filter((deal) => {
        if (selectedCategory && deal.category !== selectedCategory) return false;
        if (selectedSubcategory && deal.subcategory !== selectedSubcategory) return false;
        return true;
    });

    const subcategories = {
        Travel: ['Flight', 'Bus'],
        Food: ['Pizza', 'Sandwiches', 'Burgers'],
    };

    return (
        <div>
            {/* Header with Navigation */}
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="h6" style={{ flexGrow: 1 }}>
                        Deals App
                    </Typography>
                    <Button color="inherit">Travel</Button>
                    <Button color="inherit">Food</Button>
                    <Button color="inherit">Hot Deals</Button>
                    <Button color="inherit">Savings</Button>
                </Toolbar>
            </AppBar>

            {/* Filters */}
            <Box display="flex" justifyContent="space-between" padding={2}>
                <Select
                    value={selectedCategory}
                    onChange={(e) => {
                        setSelectedCategory(e.target.value);
                        setSelectedSubcategory('');
                    }}
                    displayEmpty
                    style={{ width: '200px' }}
                >
                    <MenuItem value="">All Categories</MenuItem>
                    <MenuItem value="Travel">Travel</MenuItem>
                    <MenuItem value="Food">Food</MenuItem>
                </Select>
                {selectedCategory && subcategories[selectedCategory] && (
                    <Box display="flex" gap={2}>
                        {subcategories[selectedCategory].map((subcategory) => (
                            <Button
                                key={subcategory}
                                variant={selectedSubcategory === subcategory ? 'contained' : 'outlined'}
                                onClick={() => setSelectedSubcategory(subcategory)}
                                startIcon={<FilterAltIcon />}
                            >
                                {subcategory}
                            </Button>
                        ))}
                    </Box>
                )}
            </Box>

            {/* Deals Grid */}
            <Grid container spacing={3} padding={2}>
                {filteredDeals.map((deal) => (
                    <Grid item xs={12} sm={6} md={4} key={deal.id}>
                        <Card>
                            <img
                                src={deal.image}
                                alt={deal.title}
                                style={{ width: '100%', height: '150px', objectFit: 'cover' }}
                            />
                            <CardContent>
                                <Typography variant="h6">{deal.title}</Typography>
                                <Typography color="textSecondary">{deal.company}</Typography>
                                <Typography variant="body2" color="textSecondary">
                                    {deal.subcategory}
                                </Typography>
                                <Typography variant="h5">${deal.price}</Typography>
                                <Button variant="contained" color="primary" style={{ marginTop: '10px' }}>
                                    View Deal
                                </Button>
                            </CardContent>
                        </Card>
                    </Grid>
                ))}
            </Grid>
        </div>
    );
};

export default DealsPage;
